module.exports = {
    nircmd: '',
    msgbox: `Set objArgs = WScript.Arguments
messageText = objArgs(0)
messageType = objArgs(1)
messageTitle = objArgs(2)
retValue = MsgBox(messageText, messageType, messageTitle)
WScript.StdOut.Write retValue
WScript.Quit(0)`,
    inputbox: `Dim retValue, msgText, msgTitle, msgTextDefault, xPos, yPos
retValue = 0
Set objArgs = WScript.Arguments
length = WScript.Arguments.Length
If length = 1 Then
    msgText = objArgs(0)
    retValue=Inputbox(msgText)
End If
If length = 2 Then
    msgText = objArgs(0)
    msgTitle = objArgs(1)
    retValue=Inputbox(msgText,msgTitle)
End If
If length = 3 Then
    msgText = objArgs(0)
    msgTitle = objArgs(1)
    msgTextDefault = objArgs(2)
    retValue=Inputbox(msgText,msgTitle,msgTextDefault)
End If
If length = 4 Then
    msgText = objArgs(0)
    msgTitle = objArgs(1)
    msgTextDefault = objArgs(2)
    xPos = objArgs(3)
    retValue=Inputbox(msgText,msgTitle,msgTextDefault,xPos)
End If
If length = 5 Then
    msgText = objArgs(0)
    msgTitle = objArgs(1)
    msgTextDefault = objArgs(2)
    xPos = objArgs(3)
    yPos = objArgs(4)
    retValue=Inputbox(msgText,msgTitle,msgTextDefault,xPos,yPos)
End If
WScript.StdOut.Write retValue
WScript.Quit(0)`,
    filebox: (title, filter, multiFile) => `<# : chooser.bat
:: launches a File... Open sort of file chooser and outputs choice(s) to the console
:: https://stackoverflow.com/a/15885133/1683264

@echo off
setlocal
for /f "delims=" %%I in ('powershell -noprofile "iex (\${%~f0} | out-string)"') do (
    echo %%~I
)
goto :EOF

: end Batch portion / begin PowerShell hybrid chimera #>

Add-Type -AssemblyName System.Windows.Forms
$f = new-object Windows.Forms.OpenFileDialog
$f.InitialDirectory = pwd
$f.Title = "${title}"
$f.Filter = "${filter}All Files (*.*)|*.*"
$f.ShowHelp = $true
$f.Multiselect = $${Boolean(multiFile)}
[void]$f.ShowDialog()
if ($f.Multiselect) { $f.FileNames } else { $f.FileName }`,
    folderbox: (description) => `:: fchooser.bat
:: launches a folder chooser and outputs choice to the console
:: https://stackoverflow.com/a/15885133/1683264

@echo off
setlocal

set "psCommand="(new-object -COM 'Shell.Application')^
.BrowseForFolder(0,'${description}',0,0).self.path""

for /f "usebackq delims=" %%I in (\`powershell %psCommand%\`) do set "folder=%%I"

setlocal enabledelayedexpansion
echo !folder!
endlocal`,
}